import { useState } from "react";
import Board from "./Board";

const BoardManager = () => {
  const [boards, setBoards] = useState([
    {
      name: "Board 1",
      link: "dkhgsdfj",
    },
    {
      name: "Board 2",
      link: "dkhgsdfj",
    },
  ]);

  return (
    <div>
      <Board />
      <Board />
    </div>
  );
};

export default BoardManager;
